import React from "react";
import "./cardSection.css";
export default function CardSection(props) {
    return (
        <div className="card-section">
            {/* <img className="img" src={} alt="img" /> */}
            <div>
                {/* image */}
                <p>{props.username}</p>
            </div>
            <div>
                <p> {props.description}</p>
                <p> {props.comment}</p>
            </div>
            <h3> {props.title} </h3>
        </div>
    );
}
